    render () {
        return (
            <div className="Track">
                <div className="Track-information">
                    <h3> Eu Gosto Dela </h3>
                    <p>  Enmicida | Enmicidio</p>
                </div>
                <button className="Track-action" onClick={this.renderAction}>{this.renderAction}</button>
            </div>
        );
    }
}
